import React from "react";
import { Link } from "react-router-dom";

function SideBar() {
  return (
    <>
      <div className="sidebar">
        <Link to="/dashboard">Dashboard</Link>
        <Link to="/admin">Admin</Link>
      </div>
    </>
  );
}

export default SideBar;
